script: |
  super -f text -I q11656.spq | sort > q11656.out

inputs:
  - name: q11656.spq
    data: |
      SELECT DISTINCT 28 + - cor2.col2 FROM tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab0 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q11656.out
    data: |
      -10
      1
      2
